Today, it has been 5 years since I started my race at the age of 50 from the 5km race in the 2016 Navy Marathon. In these 5 years I have ran 26time -10km, 28time -5 km, 1time 16 km _MPIR & 5time -21km only. 
(Also virtual 21km 2 and 15km 2 and 2 and 5 kilometers regularly.)

The 21-km Tata Marathon race was a beautiful dream of my life, which was better fulfilled. When I won the gold medal in my category in the2019_ 21-kilometer run competition _ Mumbai Games, it was the biggest achievement for me. 

Apart from all these competitions, I have been participating in all the virtual challenge races organized in institutions like 100 Days and  Indian Runners for the last two years.

My dream in the front line of the race is _Leh Ladakh Marathon which was registered on 13th September2020, unfortunately could not be organized this year.This marathon has been  planned for the next year 2021.

I know that I do not do all my races in great speed, which is very spectacular or surprising, but whenever I start my first step ahead of the starting line, I keep only two things in my mind. That one is to cross this line on my own feet as the closing line and secondly to complete my run within the stipulated time-limit. Sometimes the second thing is to complete the race within the stipulated time limit _ for this, your body cannot support you, for this you have to convince yourself that you have to complete this race happily and for yourself and not for the crowd, of course, it is slow.

Apart from running, I am regularly active in exercise and swimming. (Swimming is currently off at the moment.)

Regular swimming and strength workouts empower you  which is also essential for running. Make active activities like exercise / running a part of your lifestyle for good health and healthy living.

Be healthy by including race in running life! Be happy!  Jai Hind üôè

